import React from "react";
import { Navbar, NavItem, Row } from "react-materialize";

const Header = () => (
  <Row>
    <Navbar className="grey darken-2">
      <NavItem href="/">Login</NavItem>
      <NavItem href="/user-list">User List</NavItem>
    </Navbar>
  </Row>
);

export default Header;
